// src/components/Careers.jsx
import React from "react";

export default function Careers() {
    return (
        <div className="max-w-4xl mx-auto px-4 py-12">
            <h1 className="text-4xl font-bold text-granby-blue-dark mb-6">
                Rejoignez notre équipe
            </h1>
            <p className="mb-4">
                Nous recherchons des personnes passionnées pour offrir les meilleurs soins à nos résidents.
            </p>

            <h2 className="text-2xl font-semibold mt-8 mb-4">Postes disponibles</h2>
            <ul className="list-disc pl-6">
                <li>Infirmier(ère) auxiliaire</li>
                <li>Préposé(e) aux bénéficiaires</li>
                <li>Cuisinier(ère)</li>
            </ul>
        </div>
    );
}
